import React from "react";
import {ChangeEvent} from "react"

type CheckboxType = {
    check: boolean
    callBack: ()=>void
}

const checkboxHandl =(props:CheckboxType)=>{
    props.callBack
}

export const Checkbox =(props:CheckboxType)=> {
    return(
        <input type="checkbox" checked={props.check} onChange={(event)=>checkboxHandl(event.currentTarget.checked)}></input>
    )
}
